import React from 'react'
import {Marker} from 'react-leaflet'
import {IconLocation} from './IconLocation'



const Markers = (props)=> {

    const {data} = props;

    const markers = data.map((gasolinera, i) => (
        <Marker key={i} position = {[gasolinera[i].latitud_estacion, gasolinera[i].longitud_estacion]} icon={IconLocation}/>
    )); 
    
    console.log(markers);

    return markers;
};

export default Markers
